(function(){var e=function(e){var t="";var n=new Array;for(var r=0;r<e.length;r=r+2){var i=e.charAt(r)+e.charAt(r+1);n.push(parseInt(i.toUpperCase(),16))}var s=CRYPTEX_KEY;for(var o=0;o<=n.length/CRYPTEX_KEY.length;o++){s+=CRYPTEX_KEY}for(var r=0;r<n.length;r=r+2){var u=n[r];var a=n[r+1];var f=s.charCodeAt(r/2);if(r/2%2==0){if(a==49){t+=String.fromCharCode(u-f)}else{t+=String.fromCharCode(u-f-255)}}else{if(a==49){t+=String.fromCharCode(u+f)}else{t+=String.fromCharCode(-u+f)}}}location.href="mailto:"+t};if(typeof MooTools!="undefined"){window.addEvent("domready",function(){document.getElements("span.cryptex").addEvent("click",function(){if(this.get("rel")){e(this.get("rel"))}})})}else if(typeof jQuery!="undefined"){jQuery(document).ready(function(){jQuery("span.cryptex").click(function(){if(jQuery(this).attr("rel")){e(jQuery(this).attr("rel"))}})})}else if(typeof MooTools=="undefined"&&typeof jQuery=="undefined"){window.setTimeout(function(){var t=document.getElementsByTagName("span");for(var n=0;n<t.length;n++){if(t[n].getAttribute("class")&&t[n].getAttribute("class").indexOf("cryptex")!=-1){if(t[n].getAttribute("rel")){t[n].onclick=function(){e(this.getAttribute("rel"))}}}}},1e3)}})();